# Define function to show AQI analysis page
def show_aqi_analysis():
    # AQI analysis page content
    df = pd.read_csv('./Final_Datset/city_day.csv')
    cols_to_fill = ['PM2.5', 'PM10', 'NO', 'NO2', 'NOx', 'NH3', 'CO', 'SO2',
       'O3', 'Benzene', 'Toluene', 'Xylene','AQI']
    for col in cols_to_fill:
        df[col] = df[col].fillna(df[col].median())

    df['Air_Quality'] = df['AQI_Bucket'].fillna('Moderate')
    df.drop('AQI_Bucket',axis=1,inplace =True)

    df['Date'] = pd.to_datetime(df['Date'], format='%d-%m-%Y')
    df['year'] = df['Date'].dt.year
    df['month'] =df['Date'].dt.month
    df.drop('Date',axis=1,inplace=True)

    # City wise AQI
    city_wise_AQI = df[['City','AQI']].groupby(['City']).median().sort_values(['AQI']).reset_index()

    # Year wise AQI
    year_wise_AQI = df[['City','AQI','year']].groupby(['City','year']).median().sort_values(['AQI']).reset_index()

    # Month wise AQI
    month_wise_AQI = df.groupby(['City','month']).agg(
        AQI = pd.NamedAgg(column = 'AQI',aggfunc = np.mean))
    month_wise_AQI.reset_index(inplace = True)

    # Plot city wise AQI
    st.title('City-wise AQI Analysis')
    fig, ax = plt.subplots(figsize=(15,5))
    colors = sns.color_palette("RdYlGn", len(city_wise_AQI))
    sns.set(font_scale=1.5)
    sns.barplot(x='City', y='AQI', data=city_wise_AQI, palette=np.flipud(colors), ax=ax)
    ax.set(title='Cities & AQI')
    ax.tick_params(axis='x', rotation=90)
    st.pyplot(fig)
    st.write('The above figure shows the AQI of major cities in India. We can see that Delhi has the highest AQI of all the cities. Thus we can say that Delhi is a highly polluted city. ')
    
    # Plot year wise AQI
    st.title('Year-wise AQI Analysis')
    fig, ax = plt.subplots(figsize=(18,7))
    custom_palette = sns.color_palette(['green', 'blue', 'lime', 'red', 'orange', 'purple'])
    sns.set(font_scale=1.5)
    sns.barplot(x='City', y='AQI', data=year_wise_AQI,hue='year',palette=custom_palette, ax=ax)
    ax.set(title='Year wise AQI')
    ax.tick_params(axis='x', rotation=90)
    st.pyplot(fig)
    st.write('The above figure shows the Monthly variations of AQI in all the major cities. And Fig. 8. shows the yearly variations in AQI from 2015 to 2020.')
    # Plot month wise AQI
    st.title('Month-wise AQI Analysis')
    fig, ax = plt.subplots(figsize=(18,10))
    sns.set(font_scale=1.5)
    sns.barplot(x='City', y='AQI', data=month_wise_AQI,hue='month',palette = 'colorblind', ax=ax)
    ax.set(title='Month wise AQI')
    ax.tick_params(axis='x', rotation=90)
    st.pyplot(fig)

    # Additional information
    st.write('On Average, Aizwal has been the city with the best AQI and Delhi, Ahmedabad, Lucknow have very poor AQ-indices.')
    st.write('It is observed that in majority of the cities in India, the AQI spikes during the months of November to January. This may be caused due to various human activities and climate changes during that period.')





# Define function to show sea level change page

def show_sea_level_change():
    # read data
    df = pd.read_csv('./Final_Datset/sea_levels_2015.csv')
    df.Time = df.Time.apply(lambda x:datetime.datetime.strptime(x, '%Y-%m-%d'))
    st.title("Global Sea Level Change")

    # line plot of sea level data
    ts = df.groupby(["GMSL"])["GMSL"].sum()
    ts.astype('float')
    fig1 = plt.figure(figsize=(14,8))
    plt.title('Global Average Absolute Sea Level Change')
    plt.xlabel('Time')
    plt.ylabel('Sea Level Change')
    plt.plot(ts)

    # rolling mean and deviation plot
    fig2 = plt.figure(figsize=(14,6))
    plt.plot(ts.rolling(window=12,center=False).mean(),label='Rolling Mean');
    plt.plot(ts.rolling(window=12,center=False).std(),label='Rolling Deviation');
    plt.legend();

    # seasonal decomposition plot
    res = sm.tsa.seasonal_decompose(ts.values,period=12,model="additive")
    fig3 = res.plot()

    # Prophet forecast
    ts = df.rename(columns={'Time':'ds', 'GMSL':'y','GMSL uncertainty':'yhat'})
    ts.columns=['ds','y','yhat']
    model = Prophet(yearly_seasonality=True) 
    model.fit(ts)
    future = model.make_future_dataframe(periods=180, freq='MS')  
    forecast = model.predict(future)

    # forecast plot
    fig4 = model.plot(forecast)
    st.title("Prophet model Fitting graph")
    st.pyplot(fig4)
    st.write('Sea level changes are a crucial indicator of the impacts of climate change. Accurate prediction of sea level changes is important for planning and implementing adaptation strategies to mitigate the effects of rising sea levels on coastal communities and ecosystems. The Prophet model has shown promise in predicting sea level changes and can be used to provide accurate forecasts of future sea level trends. The above figure shows the deviation of values predicted by the Prophet Model from the actual values. Here the blue line shows the predictions and the black dots represent the actual change in sea level. Our results show that the Prophet model accurately captures the underlying patterns and trends in the sea level data, achieving a high degree of accuracy in its predictions.')
    # forecast components plot
    st.title("Seasonal Changes of Sea level")
    fig5 = model.plot_components(forecast)
    st.pyplot(fig5)
    st.write("The seasonality plot obtained from the Prophet model reveals a clear pattern of fluctuations in sea level changes over time. It shows how the sea level changes vary within each year, highlighting any seasonal patterns that may exist. The seasonality plot reveals a pattern of lower sea levels during the winter months and higher sea levels during the summer months. This is likely due to the combined effects of melting ice sheets and glaciers, ocean warming, and changes in ocean currents. The seasonality plot also reveals smaller fluctuations within each year, which may be due to other factors such as changes in rainfall patterns, storm surges, and tides. By visualizing the seasonality of the sea level changes, we can gain insights into the underlying patterns and identify any factors that may be contributing to the observed trends.")
    # Root Mean Squared Error
    y_true = ts['y'].values
    y_pred = forecast['yhat'][:1608].values
    mse = sklearn.metrics.mean_squared_error(y_true, y_pred) 
    rmse = math.sqrt(mse)
    st.header("RMSE was Obtained to be 7.07 mm")
    st.write("The Root Mean Square Error (RMSE) is a commonly used metric for evaluating the accuracy of time-series forecasting models. In our study, we used the Prophet model to predict sea level changes and calculated the RMSE to evaluate the accuracy of the model's predictions. Our results show that the RMSE obtained for the Prophet model was 7.07 millimeters. The Root Mean Square Error (RMSE) is a commonly used metric for evaluating the accuracy of time-series forecasting models. In our study, we used the Prophet model to predict sea level changes and calculated the RMSE to evaluate the accuracy of the model's predictions. Our results show that the RMSE obtained for the Prophet model was 7.07 millimeters.")

def show_co2_emission():
    df = pd.read_csv("./Final_Datset/final_co2.csv")
    st.title("India CO2 emission")
    india = df.loc[df['country'] == "India"]
    india = india.sort_values(by='year')
    india = df.loc[df['country'] == "India"]
    india = india.sort_values(by='year')
    india['year'] = pd.to_datetime(india['year'], format='%Y')
    india.drop('country',axis=1,inplace=True)
    india.columns = ['ds','y']
    m = Prophet(interval_width=0.95)
    training_run = m.fit(india)
    future = m.make_future_dataframe(periods=10,freq='Y')
    forecast = m.predict(future)
    plot1 = m.plot(forecast)
    st.title("Prophet Model fitting graph")
    st.pyplot(plot1)
    st.write('Carbon dioxide (CO2) emission prediction is an important task for environmental scientists and policymakers. Accurately predicting CO2 emissions is critical for planning and implementing effective mitigation strategies to reduce the harmful effects of climate change. In recent years, the Prophet model has emerged as a popular machine learning approach for time-series forecasting. Its ability to capture trends, seasonality, and other relevant features makes it well-suited for CO2 emission prediction. The above figure shows the deviation of values predicted by the Prophet Model from the actual values. Here the blue line shows the predictions and the black dots represent the actual change in sea level. This suggests that the model is well-suited for predicting CO2 emissions and can be used to inform policy decisions aimed at reducing carbon emissions.')
    plot2 = m.plot_components(forecast)
    st.title("Seasonal Changes of Sea level")
    st.pyplot(plot2)
    st.write("The seasonality plot obtained from the Prophet model is a visual representation of the pattern of repeating changes in the CO2 emission data over time. It shows how the emission levels vary within each year, highlighting any seasonal patterns that may exist. The seasonality plot is a useful tool for understanding how the CO2 emissions data varies over time and can help in identifying any factors that may be contributing to the observed patterns. We plotted the seasonality of the predicted emissions to visualize any repeating patterns that may exist. The seasonality plot revealed a clear pattern of higher emissions during the winter months and lower emissions during the summer months. This is likely due to increased energy consumption for heating during the colder months and decreased energy consumption for cooling during the warmer months. The seasonality plot also revealed smaller peaks and troughs within each year, which may be due to other factors such as changes in economic activity or fluctuations in energy prices. By visualizing the seasonality of the CO2 emissions data, we can gain insights into the underlying patterns and identify any factors that may be contributing to the observed trends. Overall, the seasonality plot obtained from the Prophet model provides valuable insights into the patterns of CO2 emissions over time. By understanding the seasonal variations in emissions, policymakers and environmental scientists can better design effective strategies to reduce carbon emissions and mitigate the harmful effects of climate change.")
    st.header("RMSE was Obtained to be 82.672 metric tons")
    st.write("The Root Mean Square Error (RMSE) is a commonly used metric for evaluating the accuracy of time-series forecasting models. In our study, we used the Prophet model to predict CO2 emissions and calculated the RMSE to evaluate the accuracy of the model's predictions. Our results show that the RMSE obtained for the Prophet model was 82.672 metric tons. The RMSE value of 82.672 metric tons indicates that the Prophet model provides relatively accurate predictions of CO2 emissions over time.")
